import React from 'react'
import {TileWrapper, TileHeadline, TileIcon, TileIconWrap, TileHeader, TileSubheadline} from "./CourseTileElements"


const CourseTile = ({
    headline,
    subheading
}) => {
    return (
        <>
        <TileWrapper>
            <TileHeader>
                <TileIconWrap>
                    <TileIcon />    
                </TileIconWrap>
                <TileHeadline>
                    {headline}
                </TileHeadline> 
                <TileSubheadline>
                    {subheading}
                </TileSubheadline>
            </TileHeader>
        </TileWrapper>
        </>
    )
}

export default CourseTile
